  void _onFetchPressed() {
    String state = _stateController.text.trim();
    String district = _districtController.text.trim();
    String block = _blockController.text.trim();

    if (locationData.containsKey(state) &&
        locationData[state]!.containsKey(district) &&
        locationData[state]![district]!.containsKey(block)) {
      final data = locationData[state]![district]![block]!;
      final rawValues = data["values"] as List<num>;
      final doubleValues = rawValues.map((e) => e.toDouble()).toList();
      parseData(data["dates"] as List<String>, doubleValues);
      filterData();
      Navigator.push((context), MaterialPageRoute(builder: (_) =>
          GraphPage(
              spots: spots,
              dates: filteredDates, graphKey: _graphKey, cityName: '${_blockController.text}',
          )
      )

      );

    }
    else{
      ScaffoldMessenger.of(context).showSnackBar(
      const SnackBar(content: Text("No data available for selected values"))
      );
    }
  }
  void parseData(List<String> dateStrings, List<double> values) {
    // Clean and convert string to DateTime
    List<DateTime> allDates = dateStrings.map((d) {
      String cleaned = d.trim();
      if (cleaned.startsWith("'") && cleaned.endsWith("'") && cleaned.length > 2) {
        cleaned = cleaned.substring(1, cleaned.length - 1);
      }
      return DateTime.parse(cleaned);
    }).toList();

    // Map to store one reading per day (e.g., last reading)
    Map<DateTime, double> dailyReadings = {};

    for (int i = 0; i < allDates.length; i++) {
      DateTime dateOnly = DateTime(allDates[i].year, allDates[i].month, allDates[i].day);
      // This will always keep the last reading; for first reading, use `putIfAbsent`
      dailyReadings[dateOnly] = values[i];
    }

    parsedDates = dailyReadings.keys.toList();
    filteredValues = dailyReadings.values.toList();

    // Generate FlSpot for graph
    spots = List.generate(filteredValues.length, (i) => FlSpot(i.toDouble(), filteredValues[i]));
  }

  void filterData() {
    if (selectedInterval == 'All') {
      filteredDates = parsedDates.toList();
      filteredValues = spots.map((s) => s.y).toList();
    } else {
      final now = DateTime.now();
      filteredDates = [];
      filteredValues = [];
      for (int i = 0; i < parsedDates.length; i++) {
        final date = parsedDates[i];
        if (selectedInterval == 'Year') {
          if (date.year == now.year) {
            filteredDates.add(date);
            filteredValues.add(spots[i].y);
          }
        } else if (selectedInterval == 'Month') {
          if (date.year == now.year && date.month == now.month) {
            filteredDates.add(date);
            filteredValues.add(spots[i].y);
          }
        }
      }
    }
    // Regenerate spots for the filtered data
    spots = List.generate(filteredValues.length, (i) => FlSpot(i.toDouble(), filteredValues[i]));
  }

  void onIntervalChanged(String? interval) {
    setState(() {
      selectedInterval = interval!;
      filterData();
    });
  }

  Widget buildChart() {
    final DateFormat displayFormat = DateFormat('MM-dd HH:mm');
    return SizedBox(
      height: 300,
      child: LineChart(
        LineChartData(
          minX: 0,
          maxX: spots.isEmpty ? 0 : spots.length - 1,
          minY: spots.isEmpty
              ? 0
              : spots.map((s) => s.y).reduce((a, b) => a < b ? a : b) - 0.5,
          maxY: spots.isEmpty
              ? 1
              : spots.map((s) => s.y).reduce((a, b) => a > b ? a : b) + 0.5,
          lineBarsData: [
            LineChartBarData(
              spots: spots,
              isCurved: true,
              barWidth: 3,
              color: Colors.green,
              dotData: FlDotData(show: false),
            ),
          ],
          titlesData: FlTitlesData(
            bottomTitles: AxisTitles(
              sideTitles: SideTitles(
                showTitles: true,
                interval: 2,
                getTitlesWidget: (value, meta) {
                  int index = value.toInt();
                  if (index < 0 || index >= filteredDates.length) return const SizedBox.shrink();
                  return Text(
                    displayFormat.format(filteredDates[index]),
                    style: const TextStyle(fontSize: 10, color: Colors.black),
                  );
                },
              ),
            ),
            leftTitles: AxisTitles(
              sideTitles: SideTitles(showTitles: true, interval: 0.5),
            ),
            topTitles: AxisTitles(sideTitles: SideTitles(showTitles: false)),
            rightTitles: AxisTitles(sideTitles: SideTitles(showTitles: false)),
          ),
          gridData: FlGridData(show: true),
          borderData: FlBorderData(show: true),
        ),
      ),
    );
  }

